question:
Rozważmy algorytm Kruskala w wersji:
* z pomocniczą kolejką priorytetową zaimplementowaną w kopcu-drzewie binarnym,
* operacją budowy kolejki priorytetowej PQConstruct zgodną z szybkim algorytmem konstrukcji kopca-drzewa binarnego HeapFastConstruct,
* z pomocniczą strukturą Find-Union zaimplementowaną w drzewie n-arnym z balansowaniem i kompresją ścieżek,
postaci:

```
/* Edge.weight – waga krawedzi (odległość miedzy wierzchołkami)
Edge.form, Edge.to – wierzcholek poczatkowy, wierzchozek koncowy krawędzi
Edge.mst – czy krawędź należy do konstruowanego minimalnego drzewa rozpinajacego,
                 początkowo Egdg.mst=FALSE */

void Kraskal (Graph G) {
  // G - graf wejściowy G=(V, E), E zbiór obiektow typu Edge

PriorityQueue PQ; // kolejka priorytetowa typu MIN poczatkowo pusta

FindUnion FU=INIT(G.V) ; // struktura Find-Union inicjalizowana zbiorem G.V

Edge tmp;

Vertex x, y;

PQ:=PQConstruct(G. E); // budujemy kolejkę priorytetową z obietow typu Edge
                                    // względem wartości pola weight

while (EMPTY (PQ) =FALSE) do {
  tmp:=MIN(PQ);
  DELMIN(PQ);

  X:=FIND(FU, tmp.from);

  Y:=FIND(FU, tmp.to) ;

  if (x!=y) then {
    UNION (FU, x,y) ;
    tmp.mst:=TRUE;
  }
}
```

dla grafu $G=(V,E)$:
* zbiór wierzchołków grafu $V=\{0,1,...,7\}$,
* zbiór krawędzi grafu $E$ zadany tablicą list incydencji:
	* $[0] = ((2,5), (3,2), (4,1), (6,3))$
	* $[1] = ((4,4), (5,4), (6,5))$
	* $[2] = ((0,5), (3,1), (4,4), (6,4), (7,5))$
	* $[3] = ((0,2), (2,1), (4,3), (5,5), (7,3))$
	* $[4] = ((0,1), (1,4), (2,4), (3,3), (5,4), (7,3))$
	* $[5] = ((1,4), (3,5), (4,4), (7,4))$
	* $[6] = ((0,3), (1,5), (2,4), (7,1))$
	* $[7] = ((2,5), (3,3), (4,3), (5,4), (6,1))$

